function CountryInfo(props){
    let ratio = 1
    const mystyle = {
        color: "white",
        backgroundColor: "DodgerBlue",
      };

    return (

    <>
    <div>

        {
        //.filter(props.data => props.data.common.name = "Antarctica")

        props.data.sort((a, b) => b.area - a.area).slice(0, 15).map((country) =>

            <div key={country.cca3} className="countryInfo">
                <p className="countryName">{country.name.common}</p>
                <p>{country.area} KM <sup>2</sup> </p>

                {ratio = country.area/props.data[0].area * 100}

                <div style={{mystyle, width: ratio + "%"}}>dw</div>

            </div>
        )
        }

    </div>

    </>

    )
}



export default CountryInfo;
